        catch{
            console.log(e)
            setIsDisabled(false)
        }
      };
    return (
        <div>
            <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-QWTKZyjpPEjISv5WaRU9OFeRpok6YctnYmDr5pNlyT2bRjXh0JMhjY6hW+ALEwIH" crossorigin="anonymous"/>
            <nav class="navbar navbar-expand-lg bg-body-tertiary">
                <div class="container-fluid">
                    <a class="navbar-brand" href="/dashboard">HOME</a>

                    <div class="collapse navbar-collapse" id="navbarText">
                    </div>
                </div>
            </nav>
            <form>
                <label>User Name</label>
                <input 
                    type='text' 
                    name='userName' 
                    value={userName} 
                    onChange={(e) => 
                        setUserName(e.target.value)
                    }
                /><br/>
                <label>Name</label>
                <input 
                    type='text' 
                    name='name' 
                    value={name} 
                    onChange={(e) => 
                        setName(e.target.value)
                    }
                /><br/>
                <label>Email</label>
                <input 
                    type='text' 
                    name='email' 
                    value={email} 
                    onChange={(e) => 
                        setEmail(e.target.value)
                    }
                /><br/>
                <label>Mob No</label>
                <input 
                    type='text' 
                    name='mobNo' 
                    value={mobNo} 
                    onChange={(e) => 
                        setMobNo(e.target.value)
                    }
                /><br/>
                <label>Designation</label>
                <input 
                    type='dropdown' 
                    name='designation' 
                    value={designation} 
                    onChange={(e) => 
                        setDesignation(e.target.value)
                    }
                /><br/>
                <label>Gender</label>
                <input 
                    type='text' 
                    name='gender' 
                    value={gender} 
                    onChange={(e) => 
                        setGender(e.target.value)
                    }
                /><br/>
                <label>Course</label>
                <input 
                    type='text' 
                    name='course' 
                    value={course} 
                    onChange={(e) => 
                        setCourse(e.target.value)
                    }
                /><br/>
                <label>Photo</label>
                <input 
                    type='file' 
                    name='photo' 
                    value={photo} 
                    onChange={(e) => 
                        setPhoto(e.target.value)
                    }
                /><br/>
                <button
                        type="submit"
                        value="Submit"
                        // onClick={(e) => handleSubmit(e)}
                        disabled={isDisabled}
                    >
                        Submit
                    </button>
            </form>
        </div>
    )
}
